import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import { Gallery, Item } from "react-photoswipe-gallery";
import "photoswipe/dist/photoswipe.css";
import "./frontend.css"; // Import the CSS file for styling

const StoreDetail = () => {
  const { id } = useParams();
  const [store, setStore] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [galleryImages, setGalleryImages] = useState([]);

  useEffect(() => {
    const fetchStore = async () => {
      try {
        const response = await axios.get(
          `${process.env.REACT_APP_API_URL}/api/musicstore/${id}`
        );
        setStore(response.data);
        setLoading(false);

        const imagePromises = response.data.gallery.map(async (img) => {
          const src = `${process.env.REACT_APP_API_URL}/${img}`;
          return new Promise((resolve) => {
            const image = new Image();
            image.src = src;
            image.onload = () =>
              resolve({ src, width: image.width, height: image.height });
          });
        });

        const loadedImages = await Promise.all(imagePromises);
        setGalleryImages(loadedImages);
      } catch (error) {
        console.error("Error fetching store:", error);
        setError('Failed to fetch store. Please try again later.');
        setLoading(false);
      }
    };

    fetchStore();
  }, [id]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;
  if (!store) return <div>No store found.</div>;

  return (
    <div className="store-detail bg-custom">
      <div className="container">
        <h1>{store.name}</h1>
        <div>
          {store.location && (
            <>
              Location: <span>{store.location}</span>
            </>
          )}
        </div>
        <div id="description" className="mt-3">
          <div className="row">
            <div
              className={`col-md-${galleryImages.length || store.featuredImage ? "6" : "12"}`}
            >
              <h4>About</h4>
              <div
                dangerouslySetInnerHTML={{
                  __html: store.bio || "<em>Description not available yet</em>",
                }}
              />
            </div>
            {(galleryImages.length || store.featuredImage) && (
              <div className={`col-md-${store.featuredImage ? "6" : "12"}`}>
                {store.featuredImage && (
                  <img
                    src={`${process.env.REACT_APP_API_URL}/${store.featuredImage}`}
                    alt={store.name}
                    className="store-image mb-2"
                    style={{ width: "100%", height: "auto" }}
                  />
                )}
                {galleryImages.length > 0 && (
                  <div className="gallery-container">
                    <h4>Gallery</h4>
                    <Gallery>
                      <div className="grid-container">
                        {galleryImages.map((img, index) => (
                          <Item
                            key={index}
                            original={img.src}
                            thumbnail={img.src}
                            width={img.width}
                            height={img.height}
                          >
                            {({ ref, open }) => (
                              <img
                                ref={ref}
                                onClick={open}
                                src={img.src}
                                alt={`galleryimg ${index + 1}`}
                                className="grid-item"
                                style={{ cursor: "pointer", width: "100%", height: "auto" }}
                              />
                            )}
                          </Item>
                        ))}
                      </div>
                    </Gallery>
                  </div>
                )}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default StoreDetail;
